import React from "react";
import { Link } from "react-router-dom";
import { Icon, Item } from "semantic-ui-react";

const ModifyContact = (props) => {


    return (
        <div className="ui main">
            <h2>Modify Contact</h2>
            <form className="ui form" onSubmit={props.updateContactHandler}>
                <div className="field">
                    <label>Name</label>
                    <input
                        type="text"
                        name="name"
                        defaultValue={props.location.state.name}
                        placeholder="Name"
                    />
                </div>
                <div className="field">
                    <label>Email</label>
                    <input
                        type="text"
                        name="email"
                        defaultValue={props.location.state.email}
                        placeholder="Email"
                    />
                </div>
                <button className="ui button blue">Update</button>
                <Link to="/">
                    <button className="ui button blue">Cancel</button>
                </Link>
            </form>
        </div>
    );





    }
export default ModifyContact;
